import MyPosts from './MyPosts/Post/MyPosts';
import classes from './Profile.module.css'

const Profile = () => {
    return(
        <div className={classes.content}>
        <div>
          <img src="https://wallpaperaccess.com/full/1959023.jpg"/> 
        </div>
        <div>
          ava + description
        </div>
        <MyPosts/>
      </div>
    );
}

export default Profile;
